import React from "react";
import './css/Login.css';

function Login() {
    return (
        <div className="Login">
            <h1> </h1>
            <h1>Log In</h1>
            <div class="UserName">
                <h1>User Name:</h1>
                <input type="text" placeholder="User Name"></input>
            </div>
            <div class="Password">
                <input type="text" placeholder="Password"></input>
            </div>
            <button type="submit">Log In</button>
        </div>
    );
}

export default Login;
